    method: 'get',
    url: convertRESTAPI('/applies/{id}/history', opts),
    opts: opts,
  });
}

/** 登录 */
function login_userId_get(opts) {
  return instance({
    method: 'get',
    url: convertRESTAPI('/login/{userId}', opts),
    opts: opts,
  });
}

/** 获取当前用户 */
function login_get(opts) {
  return instance({
    method: 'get',
    url: '/login',
    opts: opts,
  });
}

/** 可撤回任务列表 */
function me_revoke_tasks_get(opts) {
  return instance({
    method: 'get',
    url: '/me/revoke-tasks',
    opts: opts,
  });
}

/** 保存申请 */
function applies_id_put(opts) {
  return instance({
    method: 'put',
    url: convertRESTAPI('/applies/{id}', opts),
    opts: opts,
  });
}

/** 创建申请 */
function applies_post(opts) {
  return instance({
    method: 'post',
    url: '/applies',
    opts: opts,
  });
}

/** test2 */
